import axios from "axios";

const createOrUpdateUser = async (authtoken) => {
  return await axios.post(`${process.env.REACT_APP_API}/create-or-update-user`, {}, {
    headers: {
      authtoken
    }
  })
}

//`${process.env.REACT_APP_API}/create-or-update-user`
